        pass

    def visitLeaf(self, leaf):
        self.sum += leaf.getValue()

    def getResult(self):
        return self.sum

class ProductRedNodesVisitor(TreeVis):
    def __init__(self):
        self.product = 1

    def visitNode(self, node):
        if node.getColor() == 0:
            self.product *= node.getValue()

    def visitLeaf(self, leaf):
        if leaf.getColor() == 0:
            self.product *= leaf.getValue()

    def getResult(self):
        return self.product % 1000000007

